import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
         Hello and hello there!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
